import React from 'react'
import confetti from 'react-canvas-confetti'
const ConfettiButton = (props) => {
	const handleClick = (e) => {
		e.preventDefault();
		confetti({
			particleCount: 150,
			spread: 60
		});
	}
	return (
		<div>
			<button onClick={handleClick}>{props.txt}</button>
		</div>
	);
};


export default ConfettiButton
